import React from 'react';

const Card = ({ name, row }) => {
    return(
        <article className="center mw5 mw6-ns br3 hidden ba b--black-10 mv4 col-md-4 col-lg-4 col-xl-4">
            <h1 className="f4 bg-near-white br3 br--top black-60 mv0 pv2 ph3">Zone {name}, Row {row}</h1>
            <div className="pa3 bt b--black-10">
                <p className="f6 f5-ns lh-copy measure">
                    The Zone {name}, Row {row} cleaning is in progress.
                    The Completed status is:
                </p>
                <div className="progress">
                    <div className="progress-bar" style={{width:'70%'}}>70%</div>
                </div>
            </div>
        </article>
    );
}

export default Card;
